// src/pages/projects/Psyche.jsx
import { motion } from "framer-motion";
import BackToHome from "../../components/BackToHome";

export default function Psyche() {
  return (
    <section className="min-h-screen py-16 px-6 bg-white">
      <div className="max-w-5xl mx-auto">
        <BackToHome />
        <motion.h1 
          className="text-4xl font-bold mb-4"
          initial={{ opacity: 0, y: -20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6 }}
        >
          Jeu Virtualis√© ‚Äì L‚Äô√¢ge de Psych√©
        </motion.h1>

        <motion.p
          className="text-gray-600 mb-8 text-lg"
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          transition={{ delay: 0.2, duration: 0.6 }}
        >
          Ce projet a √©t√© r√©alis√© dans le cadre d'une SAE en √©quipe de 5 √©tudiants. Il consistait √† cr√©er une version num√©rique du jeu de soci√©t√© "L‚Äô√¢ge de Psych√©", avec une logique de jeu compl√®te, une interface graphique Swing et une architecture logicielle modulaire.
        </motion.p>

        <motion.img 
          src="/assets/age_psych√©/img_app_age_psyche.png"
          alt="Capture d'√©cran L‚Äô√¢ge de Psych√©"
          className="rounded-lg shadow mb-10 w-full object-cover"
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          transition={{ delay: 0.3, duration: 0.6 }}
          onError={(e) => {
            e.target.src = "https://via.placeholder.com/900x400?text=Image+non+trouv√©e";
            e.target.onerror = null;
          }}
        />

        <motion.div
          className="space-y-6"
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          transition={{ delay: 0.4, duration: 0.6 }}
        >
          <div>
            <h2 className="text-2xl font-semibold mb-2">Fonctionnalit√©s principales</h2>
            <ul className="list-disc list-inside text-gray-700">
              <li>Virtualisation compl√®te d‚Äôun jeu de soci√©t√© original</li>
              <li>Architecture MVC pour une s√©paration claire des responsabilit√©s</li>
              <li>Interface graphique r√©alis√©e avec Swing</li>
              <li>Lecture de fichiers pour la g√©n√©ration dynamique de la carte de jeu</li>
              <li>Coordination entre les diff√©rentes m√©caniques de jeu et gestion des actions des joueurs</li>
            </ul>
          </div>

          <div>
            <h2 className="text-2xl font-semibold mb-2">Mon r√¥le</h2>
            <p className="text-gray-700">
              J‚Äôai principalement travaill√© sur le backend en mettant en place l‚Äôarchitecture MVC, la logique m√©tier, et les syst√®mes de lecture de fichiers pour la cr√©ation dynamique de la carte. J‚Äôai √©galement jou√© un r√¥le central dans la coordination de l‚Äô√©quipe, en accompagnant mes camarades dans la r√©solution de probl√®mes techniques et l‚Äôorganisation du code.
            </p>
          </div>

          <div>
            <h2 className="text-2xl font-semibold mb-2">Stack technique</h2>
            <ul className="list-disc list-inside text-gray-700">
              <li>Java (langage principal)</li>
              <li>Swing (interface graphique)</li>
              <li>Architecture MVC</li>
              <li>Lecture de fichiers texte (pas de base de donn√©es utilis√©e)</li>
              <li>Travail collaboratif en √©quipe de 5</li>
            </ul>
          </div>

          <div className="mt-6 flex gap-4">
            <a 
              href="https://github.com/A1exPrdgc/SAE-2.01---application-final" 
              target="_blank" 
              rel="noopener noreferrer"
              className="inline-block px-6 py-3 bg-gray-100 hover:bg-gray-200 border border-gray-300 rounded text-sm font-medium"
            >
              üîó Voir le code sur GitHub
            </a>
          </div>
        </motion.div>
      </div>
    </section>
  );
}
